import React, {useState} from 'react'
import './App.css';

function App() {
  const [result, setResults] = React.useState
  return (
    <div className="App">
      <header className="App-header">
        <p>
            Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="http://react.js.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
